import React from 'react';
import {  Form, Input, Radio, Tooltip, Icon, Cascader, Select, Row, Col, Checkbox, Button, AutoComplete,} from 'antd';

const { Option } = Select;
const AutoCompleteOption = AutoComplete.Option;

const residences = [{
  value: 'zhejiang',
  label: 'Zhejiang',
  children: [{
    value: 'hangzhou',
    label: 'Hangzhou',
    children: [{
      value: 'xihu',
      label: 'West Lake',
    }],
  }],
}, {
  value: 'jiangsu',
  label: 'Jiangsu',
  children: [{
    value: 'nanjing',
    label: 'Nanjing',
    children: [{
      value: 'zhonghuamen',
      label: 'Zhong Hua Men',
    }],
  }],
}];

class SettingForm extends React.Component {

  render() {
    const { getFieldDecorator } = this.props.form;
    const { autoCompleteResult } = this.state;

    const formItemLayout = {
      labelCol: {
        xs: { span: 24 },
        sm: { span: 8 },
      },
      wrapperCol: {
        xs: { span: 24 },
        sm: { span: 16 },
      },
    };

    return (
      <Form {...formItemLayout} onSubmit={this.handleSubmit}>
      	<Form.Item label={( <span>Include Haeder&nbsp;</span>)} >
      		<Radio>Radio</Radio>
      		<Radio className="float_right">Radio</Radio>
      	</Form.Item>

        <Form.Item label={( <span>Header&nbsp;</span>)} >
          {(
            <Input />
          )}
        </Form.Item>


        <Form.Item label={( <span>Left Text&nbsp;</span>)} >
          {(
            <Input />
          )}
        </Form.Item>

         <Form.Item label={( <span>Right Text&nbsp;</span>)} >
          {(
            <Input />
          )}
        </Form.Item>

      </Form>
    );
  }
}

export default SettingForm
